import React from 'react'
import { useSelector } from 'react-redux'
import { Box, Typography } from "@mui/material";

const ViewTodo = () => {
  const todos = useSelector((state) => state.todos.todos)
  console.log(todos)
  return (
    <div>
     {
        todos.map((todo) =>(
          <Box key={todo.id}>
          <Typography >{todo.text}</Typography>
          </Box>
        ))
      }
      </div>
  )
}

export default ViewTodo
